  false,\n\t\"url\": null,\n\t\"notes\": \"Cowardinu00e2u0080u0099s Classification
  of Wetlands and Deep Water Habitats of the United States (http://www.npwrc.usgs.gov/resource/wetlands/classwet/index.htm),
  together with a water regime modifier applied at the Class level, serves as a standard
  for regulatory agencies across the country. Important variables captured in this
  system include the source of water, vegetation class and subclass type (height and
  life form), and substrate. We used his system to classify extant wetlands for the
  big river floodplains analyzed. The following general process was used for classification
  and mapping. 1. Identify wetland system based on source of water. 2. Identify wetland
  class type based on vegetation height, and subclass based on life form (evergreen
  versus deciduous). 3. Create an index to water regime (a modifier applied at the
  class level) based on landform (sinks) and soil drainage class. 4. Execute mapping
  based on attribution of these variables (system, water regime, vegetation class
  and subclass) to image objects generated from LiDAR information. Water regime was
  defined based both on relative elevation, from which sinks were identified, and
  soil drainage class. Results were designed to provide an index to Cowardinu00e2u0080u0099s
  water regime definitions. About 28.8% of the big river floodplains within the study
  area were uplands, and 71.2% was wetland. Seasonally flooded areas accounted for
  16.4% of the study area, whereas relatively drier temporarily flooded and saturated
  areas made up 37.8% of the area. The temporarily flooded and saturated classes were
  liberally defined in order to circumscribe all areas that may support a water regime
  where wetlands could form. Thus, we are likely to have over-represented rather than
  under-represent the extent of wetlands on the big river floodplains.\",\n\t\"license_title\":
